import React from 'react'
import "./service.css"
import rocket from "./rocket-icon.svg";
import del from "./delete-icon.svg";
import pen from "./menu-designer.svg";
import menu from "./menu-icon.svg";

function Service({element,key}) {
    return (
        <div className="service" key={key}>
            <div className="service-name">
                <h4>{element.name}</h4>
                {/* <h4>PREDICTIVE MAINTAINCE</h4> */}
            </div>

            <div className="service-created">
                <h5>{element.created}</h5>
                {/* <h5>27-04-2020</h5> */}
            </div>

            <div className="service-modified">
                <h5>{element.modified}</h5>
            </div>

            <div className="service-createdBy">
                <h5>{element.created_by.substring(0,9)}</h5>
                {/* <h5>Employee 1</h5> */}
            </div>

            <div className="actions-div">
                <img id ="actions-items" src={rocket} alt="deploy"/>
                <img id ="actions-items" src={del} alt="delete"/>
                <img id ="actions-items" src={pen} alt="edit"/>
                <img id ="actions-items" src={menu} alt="menu"/>

            </div>
        </div>
    )
}

export default Service
